INSERT INTO `t_baq_wglx` VALUES ('99', '99', '系统预置数据', '0000000007002', '其他违规情况', '0000000002002', '2016-06-26 21:23:01', '超级管理员');
INSERT INTO `t_baq_yjgz` VALUES ('0000000013001', null, '10', '0000000013001', '2016-10-09 15:54:57', '当某传唤证中的“填发时间”之后12小时和24小时两个时点，则系统发送预警消息给“填发人”和消息发送时点的“案件法制审核人”；共发送预警消息两次；', '传唤到期预警', '30', '0000000002002', '0000000015002', '2016-10-09 15:54:57', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013002', '10:00,11:00,12:00', null, '0000000013002', '2016-10-09 14:24:01', '某拘留证中的“批准时间”之后+2天的某个时间点，则系统自动发送预警消息给“填发人”和消息发送时点的“案件法制审核人”', '刑拘到期预警', '60', '0000000002002', '0000000015002', '2016-10-09 14:56:17', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013003', '10:00,11:00,12:00', null, '0000000013003', '2016-10-09 14:24:14', '若“延长拘留期限通知书”的执行日期到延期至日期为7天的，则提前1天开始预警；若“延长拘留期限通知书”的执行日期到延期至日期为30天的，则提前7天开始预警。并则系统自动发送预警消息给“填发人”和“案件法制审核人”', '延长刑拘到期预警', '30', '0000000002002', '0000000015002', '2016-10-09 14:24:14', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013004', '10:00,11:00,12:00', null, '0000000013004', '2016-10-09 14:24:24', '“取保候审决定/执行通知书”起算日期之后达半年到期。则在起算之日起达到2个月时，预警提醒；达到4个月时，预警提醒；离到期日前的15天预警提醒；离到期日前的7天预警提醒；离到期日前1天预警提醒；', '取保到期预警', '30', '0000000002002', '0000000015002', '2016-10-09 14:24:24', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013005', '10:00,11:00,12:00', null, '0000000013005', '2016-10-09 14:24:32', '“监视居住决定/执行通知书”起算日期之后达半年到期。则在起算之日起达到2个月时，预警提醒；达到4个月时，预警提醒；离到期日前的15天预警提醒；离到期日前的7天预警提醒；离到期日前1天预警提醒；', '监视居住到期预警', '30', '0000000002002', '0000000015002', '2016-10-09 14:24:32', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013006', '10:00,11:00,12:00', null, '0000000013006', '2016-10-09 14:24:42', '“逮捕证”填发日期后的2个月则需“呈请提起起诉报告书”。则在填发日期后的第50天时，提醒一次；第59天再提醒一次；', '逮捕后移送起诉预警', '30', '0000000002002', '0000000015002', '2016-10-09 14:24:42', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013007', '8,12', '10', '0000000013007', '2016-10-09 14:30:38', '当进入办案区时间超过预警设置时间，仍未办理最终离开业务，则系统自动对新增该办案区使用单的相关办案民警和预警设置的用户和相应角色的用户进行消息预警。', '进入办案区超时预警', '11', '0000000002002', '0000000015002', '2016-10-11 21:15:45', '0000000014001,0000000014002', '办案区模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013008', null, '10', '0000000013008', '2016-10-09 17:34:55', '某犯罪嫌疑人的“刑事_扣押决定书”或“证据保全清单”文书，达24小时，但仍未在本系统中办理“涉案物品入库”，则系统发送预警消息给办案民警以及该案件法制审核人；', '扣押物品到期未入库预警', '30', '0000000002002', '0000000015002', '2016-10-09 17:36:58', '0000000014001,0000000014002', '涉案物品模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013009', '2,2,03:10;20,3,10:00', null, '0000000013009', '2017-03-18 15:44:34', '发生退侦后在补充侦查周期到期前，对办案民警以及法制审核人进行预警；', '退侦后补充侦查到期提醒', '11', '0000000002002', '0000000015002', '2017-03-18 21:25:31', '0000000014001,0000000014002', '案件监控模块', null, null);
INSERT INTO `t_baq_yjgz` VALUES ('0000000013010', null, 120, '0000000013010', '2017-04-24 15:44:34', '对进入暂存物品保管区的物品，超过24小时未办理返还的，进行提前预警提醒。', '暂存物品超时未返还预警', '30', '0000000002002', '0000000015002', '2017-04-24 15:44:34', '0000000014001,0000000014002', '涉案物品模块', null, null);
